UNI sampler2D GridInputTexture; 
UNI sampler2D CamInputTexture; 
UNI float amt;
UNI float freq;
UNI float amp;
UNI float time;
IN vec2 texCoord;

{{MODULES_HEAD}}
void main()
{

    vec4 cam = texture2D(CamInputTexture,texCoord);
    float avg = dot(cam.rgb, vec3(0.3333));
    float disp = avg * amt;

    float sineWave = sin(texCoord.x * freq + time) * amp * disp;
    vec2 distort = vec2(0.0,sineWave);
    vec4 tex = texture2D(GridInputTexture,texCoord + distort);
    {{MODULE_COLOR}}
    outColor = tex;
}

{{MODULES_HEAD}}
IN vec3 vPosition;
IN vec2 attrTexCoord;
IN vec3 attrVertNormal;
IN vec3 attrTangent,attrBiTangent;

IN float attrVertIndex;

OUT vec2 texCoord;
OUT vec3 norm;
UNI mat4 projMatrix;
UNI mat4 viewMatrix;
UNI mat4 modelMatrix;

void main()
{
    texCoord=attrTexCoord;
    norm=attrVertNormal;
    vec4 pos=vec4(vPosition,  1.0);
    vec3 tangent=attrTangent;
    vec3 bitangent=attrBiTangent;
    mat4 mMatrix=modelMatrix;
    {{MODULE_VERTEX_POSITION}}
    gl_Position = projMatrix * (viewMatrix*mMatrix) * pos;
}

